DELIMITER $$
--
-- Процедуры
--
CREATE DEFINER=`Sirkadirov`@`%` PROCEDURE `updateBCount` (IN `uId` BIGINT UNSIGNED)  begin
DECLARE sumVal FLOAT;
SELECT SUM(`b`) INTO `sumVal` FROM `spm_submissions` WHERE (`userId` = uId AND `b` > 0);
UPDATE `spm_users` SET `bcount` = sumVal WHERE `id` = uId LIMIT 1;
end$$

CREATE DEFINER=`Sirkadirov`@`%` PROCEDURE `updateRating` (IN `urId` BIGINT UNSIGNED)  begin

# Required variablesDECLARE sumVal FLOAT;
DECLARE rProblemsCount TINYINT;

# Summ of rating problemsSELECT SUM(`b`) INTO `sumVal` FROM `spm_submissions` WHERE (`userId` = urId AND `b` > 0) ORDER BY `b` DESC LIMIT 30;

# Rating problems countSELECT COUNT(`submissionId`) INTO `rProblemsCount` FROM `spm_submissions` WHERE (`userId` = urId AND `b` > 0) ORDER BY `b` DESC LIMIT 30;

# Update user rating in databaseUPDATE `spm_users` SET `rating` = (sumVal / rProblemsCount) WHERE `id` = urId LIMIT 1;

end$$

DELIMITER ;

