(1, 1, '2016-12-18', 'Создание системы', '&lt;p&gt;&lt;strong&gt;Эта дата ознаменуется как день создания системы проверки решений Simple Problems Manager!&amp;nbsp;&lt;img src=&quot;tpl/default/js/tinymce/plugins/emoticons/img/smiley-cool.gif&quot; alt=&quot;cool&quot; /&gt;&lt;/strong&gt;&lt;br /&gt; Да пребудет сила с разработчиками и первыми пользователями системы!&amp;nbsp;&lt;img src=&quot;tpl/default/js/tinymce/plugins/emoticons/img/smiley-wink.gif&quot; alt=&quot;wink&quot; /&gt;&lt;/p&gt;'),
(2, 1, '2017-01-08', 'Первый закрытый тест системы', '&lt;p&gt;&lt;strong&gt;Привет всем! Рад сообщить о том, что сейчас стартует первое закрытое тестирование системы SimplePM!&amp;nbsp;&lt;img src=&quot;tpl/default/js/tinymce/plugins/emoticons/img/smiley-smile.gif&quot; alt=&quot;smile&quot; /&gt;&lt;img src=&quot;tpl/default/js/tinymce/plugins/emoticons/img/smiley-smile.gif&quot; alt=&quot;smile&quot; /&gt;&lt;img src=&quot;tpl/default/js/tinymce/plugins/emoticons/img/smiley-wink.gif&quot; alt=&quot;wink&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Сейчас готов лишь базовый функционал системы, не считая системы проверки решений, такой как новости сайта, мини - социальная сеть, список доступных задач, некоторый функциоал учителей и кураторов а также полный функционал административной панели. &lt;strong&gt;Подробнее о рабочем функционале системы вы можете узнать из записи выше.&lt;/strong&gt;&lt;/p&gt;\r\n&lt;blockquote&gt;\r\n&lt;p&gt;При нахождении багов, лазеек и недочётов просьба сообщать о этом администратору системы, Кадирову Юрию, через внутреннюю систему личных сообщений или с помощью email: &lt;a href=&quot;mailto:admin@sirkadirov.com&quot;&gt;admin@sirkadirov.com&lt;/a&gt;&amp;nbsp;!&lt;/p&gt;\r\n&lt;/blockquote&gt;\r\n&lt;p&gt;&lt;strong&gt;И да пребудет с вами сила!&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;С уважением, Администратор системы.&lt;/p&gt;'),
(4, 1, '2017-02-24', 'DEV VARIABLES', '&lt;h3 id=&quot;mcetoc_1b9o7uqpf0&quot;&gt;UserMarks&lt;/h3&gt;\r\n&lt;ul style=&quot;list-style-type: square;&quot;&gt;\r\n&lt;li&gt;&lt;span style=&quot;background-color: #999999;&quot;&gt;&lt;strong&gt;PRIORITY_NULL&lt;/strong&gt;&lt;/span&gt; (0) default&lt;/li&gt;\r\n&lt;li&gt;&lt;span style=&quot;background-color: #ffff00;&quot;&gt;&lt;strong&gt;PRIORITY_USER&lt;/strong&gt;&lt;/span&gt; (2) non-default (решение и отправка задач, просмотр списка задач и т.д.)&lt;/li&gt;\r\n&lt;li&gt;&lt;span style=&quot;background-color: #ff6600;&quot;&gt;&lt;strong&gt;PRIORITY_CURATOR&lt;/strong&gt;&lt;/span&gt; (4) non-default (can do all as admin, api classes calling allowed)&lt;/li&gt;\r\n&lt;li&gt;&lt;span style=&quot;background-color: #ff0000;&quot;&gt;&lt;strong&gt;PRIORITY_SUDO_MODE&lt;/strong&gt;&lt;/span&gt; (8) non-default [admin only] all functions allowed&lt;/li&gt;\r\n&lt;li&gt;&lt;span style=&quot;background-color: #999999;&quot;&gt;&lt;strong&gt;ONLY_IP_{IPv4}&lt;/strong&gt;&lt;/span&gt; (16) {IPv4}=IP_adress (разрешение на вход лишь с определённого IP) (combine this to set non-one element list)&lt;/li&gt;\r\n&lt;li&gt;&lt;span style=&quot;background-color: #00ff00;&quot;&gt;AMO_FELES (256)&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3 id=&quot;mcetoc_1b9o8g1ch1&quot;&gt;NodeJS Control panel server&lt;/h3&gt;\r\n&lt;p style=&quot;padding-left: 30px;&quot;&gt;&lt;span style=&quot;background-color: #ff0000; color: #ffffff;&quot;&gt;&lt;strong&gt;ВЫ ДОЛЖНЫ ИМЕТЬ ПОЛНОМОЧИЯ ADMIN 287 PRIORITY_SUDO_MODE ЧТОБЫ ПРОСМОТРЕТЬ ДАННЫЙ КОНТЕНТ&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;'),
(3, 1, '2017-01-16', 'Готовый функционал системы', '&lt;p&gt;&lt;strong&gt;Разработка системы идёт полным ходом, но некоторые разделы сайта всё-таки остаются недоделанными. В этой новости будет размещён список всех доступных на данный момент разделов сайта, функционал которых полностью реализован. Этот список будет постоянно обновляться.&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul style=&quot;list-style-type: square;&quot;&gt;\r\n&lt;li&gt;Новости системы&lt;/li&gt;\r\n&lt;li&gt;Страницы сайта&lt;/li&gt;\r\n&lt;li&gt;Список пользователей сайта&lt;/li&gt;\r\n&lt;li&gt;Все разделы администраторской панели&lt;/li&gt;\r\n&lt;li&gt;Система личных сообщений&lt;/li&gt;\r\n&lt;li&gt;Функция изменения пароля&lt;/li&gt;\r\n&lt;li&gt;Профайлы пользователей&lt;/li&gt;\r\n&lt;li&gt;Модули &quot;Пользователи онлайн&quot;, &quot;Дни рождения&quot; и ссылка&amp;nbsp;на раздел &quot;Личные сообщения/Входящие&quot;&lt;/li&gt;\r\n&lt;li&gt;TeacherID&lt;/li&gt;\r\n&lt;li&gt;Лицензионное соглашение (как же без него!)&lt;/li&gt;\r\n&lt;li&gt;Частично реализован архив задач&lt;/li&gt;\r\n&lt;li&gt;Отправка задач доступна лишь группе &lt;strong&gt;admin&lt;/strong&gt; с меткой &lt;strong&gt;PRIORITY_USER&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;/p&gt;'),
(5, 1, '2017-03-11', 'DEV LINKS', '&lt;ul style=&quot;list-style-type: square;&quot;&gt;\r\n&lt;li&gt;&lt;strong&gt;SimplePM Web Client&lt;/strong&gt; (&lt;a href=&quot;http://37.57.143.185:80&quot;&gt;http://37.57.143.185:80&lt;/a&gt; | &lt;a href=&quot;http://127.0.0.1:80&quot;&gt;https://127.0.0.1:80&lt;/a&gt;&amp;nbsp;| &lt;a href=&quot;http://localhost:80&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;https://localhost:80&lt;/a&gt; | &lt;a href=&quot;http://192.168.2.3:80&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;https://192.168.2.3:80&lt;/a&gt;)&lt;/li&gt;\r\n&lt;li&gt;&lt;strong&gt;phpMyAdmin&lt;/strong&gt; [только локальный доступ, Winвows auth] (&lt;a href=&quot;http://127.0.0.1:8081&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;https://127.0.0.1:8081&lt;/a&gt;)&lt;/li&gt;\r\n&lt;li&gt;&lt;strong&gt;MySQL Server&lt;/strong&gt; [только локальный доступ] (&lt;a href=&quot;//192.168.2.2&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;192.168.2.2&lt;/a&gt;)&lt;/li&gt;\r\n&lt;li&gt;&lt;strong&gt;IIS Remote control&lt;/strong&gt; (&lt;a href=&quot;https://manage.iis.net/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;https://manage.iis.net/&lt;/a&gt;)&lt;/li&gt;\r\n&lt;/ul&gt;'),
(6, 1, '2017-03-27', 'АХТУНГ! БАГИ!', '&lt;blockquote&gt;\r\n&lt;p&gt;Если вы нашли какой-либо баг, а может даже не баг, а незапланированную фичу - сразу же обращайтесь к разработчику системы Кадирову Юрию с помощью внутренней системы личных сообщений или же по email: &lt;a href=&quot;mailto:admin@sirkadirov.com&quot;&gt;admin@sirkadirov.com&lt;/a&gt;&amp;nbsp;!&lt;/p&gt;\r\n&lt;p&gt;Все пользователи, нашедшие неизвестный к тому времени баг будут вознаграждены!&lt;/p&gt;\r\n&lt;/blockquote&gt;\r\n&lt;p&gt;&lt;strong&gt;С уважением, Администрация сайта.&lt;/strong&gt;&lt;/p&gt;'),
(7, 1, '2017-03-30', 'Video example', '&lt;p&gt;&lt;iframe src=&quot;//www.youtube.com/embed/4fFHF57YI54&quot; width=&quot;100%&quot; height=&quot;500px&quot; allowfullscreen=&quot;allowfullscreen&quot;&gt;&lt;/iframe&gt;&lt;/p&gt;');

