INSERT INTO `spm_pages` (`id`, `name`, `content`) VALUES
(1, 'О системе', '&lt;p&gt;&lt;strong&gt;SimplePM&lt;/strong&gt; - &lt;em&gt;это автоматизированная система проверки решений задач по программированию. Она поддерживает C#, C++, Objective C, Lua, Pascal, Delphi, VB.NET и другие. Разработка системы&amp;nbsp;находится в активном состоянии.&lt;br /&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;&lt;strong&gt;На данный момент существует не так много систем проверки решений, причём большинство из них имеют скудный функционал, их развитие и дизайн застрял где-то в 2007, а их лицензирование для коммерческого применения или совсем отсутствует, или слишком сложно происходит (не говоря уж о цене).&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;h3&gt;Какие цели мы поставили перед собой?&lt;/h3&gt;\r\n&lt;ul style=&quot;list-style-type: square;&quot;&gt;\r\n&lt;li&gt;Расширить круг применения систем проверки решений задач по спортивному программированию&lt;/li&gt;\r\n&lt;li&gt;Предоставить возможность одарённым студентам развиваться и самореализоваться&lt;/li&gt;\r\n&lt;li&gt;Создать простую систему монетизации коммерческих проектов&lt;/li&gt;\r\n&lt;li&gt;Предоставить возможность работодателям оценивать знания своих подчинённых и потенциальных кадров&lt;/li&gt;\r\n&lt;li&gt;Предоставить учителям информатики мощный инструмент для проведения уроков, практических и контрольных работ&lt;/li&gt;\r\n&lt;li&gt;Предоставить атакостойкий и воистину могучий инструмент для проведения школьных, районных, городских, областных и республиканских олимпиад&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3&gt;Безопасность - превыше всего&lt;/h3&gt;\r\n&lt;p&gt;Все решения задач, предоставленные учениками запускаются в виртуальной машине под управлением &lt;strong&gt;ОС Linux&lt;/strong&gt; от имени &lt;em&gt;&lt;strong&gt;рядового пользователя&lt;/strong&gt;&lt;/em&gt;, с &lt;em&gt;&lt;strong&gt;ограничениями&lt;/strong&gt; &lt;strong&gt;по времени исполнения&lt;/strong&gt;&lt;/em&gt;, &lt;em&gt;&lt;strong&gt;доступной&lt;/strong&gt; &lt;strong&gt;оперативной и физической памяти&lt;/strong&gt;&lt;/em&gt;, ещё стоит отметить, что &lt;em&gt;&lt;strong&gt;использование некоторых функций ЯП запрещено&lt;/strong&gt;&lt;/em&gt;. Это значит что вы находитесь в &lt;em&gt;&lt;strong&gt;полной безопасности&lt;/strong&gt;&lt;/em&gt;!&lt;/p&gt;'),
(2, 'Правила работы', '&lt;p&gt;&lt;strong&gt;Раздел находится в состоянии заполнения.&lt;/strong&gt;&lt;/p&gt;'),
(3, 'Коды ошибок', '&lt;p&gt;На данной странице вы можете просмотреть все возможные ошибки, которые возникают при отладке приложений.&lt;/p&gt;\r\n&lt;h2&gt;Free Pascal&lt;/h2&gt;\r\n&lt;p&gt;&lt;strong&gt;1 Invalid function number &lt;/strong&gt;&lt;br /&gt;An invalid operating system call was attempted. &lt;br /&gt;&lt;strong&gt;2 File not found&lt;/strong&gt; &lt;br /&gt;Reported when trying to erase, rename or open a non-existent file. &lt;br /&gt;&lt;strong&gt;3 Path not found&lt;/strong&gt; &lt;br /&gt;Reported by the directory handling routines when a path does not exist or is invalid. Also reported when trying to access a non-existent file. &lt;br /&gt;&lt;strong&gt;4 Too many open files &lt;/strong&gt;&lt;br /&gt;The maximum number of files currently opened by your process has been reached. Certain operating systems limit the number of files which can be opened concurrently, and this error can occur when this limit has been reached. &lt;br /&gt;&lt;strong&gt;5 File access denied&lt;/strong&gt;&lt;br /&gt;Permission to access the file is denied. This error might be caused by one of several reasons: &lt;br /&gt;Trying to open for writing a file which is read-only, or which is actually a directory. &lt;br /&gt;File is currently locked or used by another process. &lt;br /&gt;Trying to create a new file, or directory while a file or directory of the same name already exists. &lt;br /&gt;Trying to read from a file which was opened in write-only mode. &lt;br /&gt;Trying to write from a file which was opened in read-only mode. &lt;br /&gt;Trying to remove a directory or file while it is not possible. &lt;br /&gt;No permission to access the file or directory. &lt;br /&gt;&lt;strong&gt;6 Invalid file handle &lt;/strong&gt;&lt;br /&gt;If this happens, the file variable you are using is trashed; it indicates that your memory is corrupted. &lt;br /&gt;&lt;strong&gt;12 Invalid file access code &lt;/strong&gt;&lt;br /&gt;Reported when a reset or rewrite is called with an invalid FileMode value. &lt;br /&gt;&lt;strong&gt;15 Invalid drive number &lt;/strong&gt;&lt;br /&gt;The number given to the Getdir or ChDir function specifies a non-existent disk. &lt;br /&gt;&lt;strong&gt;16 Cannot remove current directory &lt;/strong&gt;&lt;br /&gt;Reported when trying to remove the currently active directory. &lt;br /&gt;&lt;strong&gt;17 Cannot rename across drives &lt;/strong&gt;&lt;br /&gt;You cannot rename a file such that it would end up on another disk or partition. &lt;br /&gt;&lt;br /&gt;&lt;strong&gt;100 Disk read error &lt;/strong&gt;&lt;br /&gt;An error occurred when reading from disk. Typically happens when you try to read past the end of a file. &lt;br /&gt;&lt;strong&gt;101 Disk write error &lt;/strong&gt;&lt;br /&gt;Reported when the disk is full, and you&amp;rsquo;re trying to write to it. &lt;br /&gt;&lt;strong&gt;102 File not assigned &lt;/strong&gt;&lt;br /&gt;This is reported by Reset, Rewrite, Append, Rename and Erase, if you call them with an unassigned file as a parameter. &lt;br /&gt;&lt;strong&gt;103 File not open &lt;/strong&gt;&lt;br /&gt;Reported by the following functions : Close, Read, Write, Seek, EOf, FilePos, FileSize, Flush, BlockRead, and BlockWrite if the file is not open. &lt;br /&gt;&lt;strong&gt;104 File not open for input &lt;/strong&gt;&lt;br /&gt;Reported by Read, BlockRead, Eof, Eoln, SeekEof or SeekEoln if the file is not opened with Reset. &lt;br /&gt;&lt;strong&gt;105 File not open for output &lt;/strong&gt;&lt;br /&gt;Reported by write if a text file isn&amp;rsquo;t opened with Rewrite. &lt;br /&gt;&lt;strong&gt;106 Invalid numeric format &lt;/strong&gt;&lt;br /&gt;Reported when a non-numeric value is read from a text file, and a numeric value was expected. &lt;br /&gt;&lt;br /&gt;&lt;strong&gt;200 Division by zero &lt;/strong&gt;&lt;br /&gt;The application attempted to divide a number by zero. &lt;br /&gt;&lt;strong&gt;201 Range check error &lt;/strong&gt;&lt;br /&gt;If you compiled your program with range checking on, then you can get this error in the following cases: &lt;br /&gt;An array was accessed with an index outside its declared range. &lt;br /&gt;Trying to assign a value to a variable outside its range (for instance an enumerated type). &lt;br /&gt;&lt;strong&gt;202 Stack overflow error &lt;/strong&gt;&lt;br /&gt;The stack has grown beyond its maximum size (in which case the size of local variables should be reduced to avoid this error), or the stack has become corrupt. This error is only reported when stack checking is enabled. &lt;br /&gt;&lt;strong&gt;203 Heap overflow error &lt;/strong&gt;&lt;br /&gt;The heap has grown beyond its boundaries. This is caused when trying to allocate memory explicitly with New, GetMem or ReallocMem, or when a class or object instance is created and no memory is left. Please note that, by default, Free Pascal provides a growing heap, i.e. the heap will try to allocate more memory if needed. However, if the heap has reached the maximum size allowed by the operating system or hardware, then you will get this error. &lt;br /&gt;&lt;strong&gt;204 Invalid pointer operation &lt;/strong&gt;&lt;br /&gt;You will get this in several cases: &lt;br /&gt;if you call Dispose or Freemem with an invalid pointer &lt;br /&gt;in case New or GetMem is called, and there is no more memory available. The behaviour in this case depends on the setting of ReturnNilIfGrowHeapFails. If it is True, then Nil is returned. if False, then runerror 204 is raised. &lt;br /&gt;&lt;strong&gt;205 Floating point overflow &lt;/strong&gt;&lt;br /&gt;You are trying to use or produce real numbers that are too large. &lt;br /&gt;&lt;strong&gt;206 Floating point underflow &lt;/strong&gt;&lt;br /&gt;You are trying to use or produce real numbers that are too small. &lt;br /&gt;&lt;strong&gt;207 Invalid floating point operation &lt;/strong&gt;&lt;br /&gt;Can occur if you try to calculate the square root or logarithm of a negative number. &lt;br /&gt;&lt;strong&gt;210 Object not initialized &lt;/strong&gt;&lt;br /&gt;When compiled with range checking on, a program will report this error if you call a virtual method without having called its object&amp;rsquo;s constructor. &lt;br /&gt;&lt;strong&gt;211 Call to abstract method &lt;/strong&gt;&lt;br /&gt;Your program tried to execute an abstract virtual method. Abstract methods should be overridden, and the overriding method should be called. &lt;br /&gt;&lt;strong&gt;212 Stream registration error &lt;/strong&gt;&lt;br /&gt;This occurs when an invalid type is registered in the objects unit. &lt;br /&gt;&lt;strong&gt;213 Collection index out of range &lt;/strong&gt;&lt;br /&gt;You are trying to access a collection item with an invalid index (objects unit). &lt;br /&gt;&lt;strong&gt;214 Collection overflow error &lt;/strong&gt;&lt;br /&gt;The collection has reached its maximal size, and you are trying to add another element (objects unit). &lt;br /&gt;&lt;strong&gt;215 Arithmetic overflow error &lt;/strong&gt;&lt;br /&gt;This error is reported when the result of an arithmetic operation is outside of its supported range. Contrary to Turbo Pascal, this error is only reported for 32-bit or 64-bit arithmetic overflows. This is due to the fact that everything is converted to 32-bit or 64-bit before doing the actual arithmetic operation. &lt;br /&gt;&lt;strong&gt;216 General Protection fault &lt;/strong&gt;&lt;br /&gt;The application tried to access invalid memory space. This can be caused by several problems: &lt;br /&gt;Dereferencing a nil pointer. &lt;br /&gt;Trying to access memory which is out of bounds (for example, calling move with an invalid length). &lt;br /&gt;&lt;strong&gt;217 Unhandled exception occurred &lt;/strong&gt;&lt;br /&gt;An exception occurred, and there was no exception handler present. The sysutils unit installs a default exception handler which catches all exceptions and exits gracefully. &lt;br /&gt;&lt;strong&gt;218 Invalid value specified &lt;/strong&gt;&lt;br /&gt;Error 218 occurs when an invalid value was specified to a system call, for instance when specifying a negative value to a seek() call. &lt;br /&gt;&lt;strong&gt;219 Invalid typecast &lt;/strong&gt;&lt;br /&gt;Thrown when an invalid typecast is attempted on a class using the as operator. This error is also thrown when an object or class is typecast to an invalid class or object and a virtual method of that class or object is called. This last error is only detected if the -CR compiler option is used. &lt;br /&gt;&lt;br /&gt;&lt;strong&gt;222 Variant dispatch error &lt;/strong&gt;&lt;br /&gt;No dispatch method to call from variant. &lt;br /&gt;&lt;strong&gt;223 Variant array create &lt;/strong&gt;&lt;br /&gt;The variant array creation failed. Usually when there is not enough memory. &lt;br /&gt;&lt;strong&gt;224 Variant is not an array &lt;/strong&gt;&lt;br /&gt;This error occurs when a variant array operation is attempted on a variant which is not an array. &lt;br /&gt;&lt;strong&gt;225 Var Array Bounds check error &lt;/strong&gt;&lt;br /&gt;This error occurs when a variant array index is out of bounds. &lt;br /&gt;&lt;strong&gt;227 Assertion failed error &lt;/strong&gt;&lt;br /&gt;An assertion failed, and no AssertErrorProc procedural variable was installed. &lt;br /&gt;&lt;strong&gt;229 Safecall error check &lt;/strong&gt;&lt;br /&gt;This error occurs is a safecall check fails, and no handler routine is available. &lt;br /&gt;&lt;strong&gt;231 Exception stack corrupted &lt;/strong&gt;&lt;br /&gt;This error occurs when the exception object is retrieved and none is available. &lt;br /&gt;&lt;strong&gt;232 Threads not supported &lt;/strong&gt;&lt;br /&gt;Thread management relies on a separate driver on some operating systems (notably, Unixes). The unit with this driver needs to be specified on the uses clause of the program, preferably as the first unit (cthreads on unix).&lt;/p&gt;'),
(4, 'Полезные ссылки', '&lt;p&gt;На данной странице вы можете просмотреть список полезных ссылок на тему разработки программного обеспечения, но придупреждаем: используйте их с максимальной осторожностью!&lt;/p&gt;\r\n&lt;ul style=&quot;list-style-type: square;&quot;&gt;\r\n&lt;li&gt;&lt;a href=&quot;https://sirkadirov.com/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Sirkadirov Limited&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;https://blog.sirkadirov.com/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Блог Кадирова Юрия&lt;/a&gt; - туториалы, обзоры, хвастаньё, сорцы, портфолио и многое-многое другое!&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://yun.zp.ua&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Система проверки решений &quot;ЮНый Программист&quot;&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://s28.zp.ua/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Сайт Запорожской гимназии №28&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://msdn.microsoft.com/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Microsoft Software Developer Network&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://visualstudio.com/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Visual Studio&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://www.mono-project.com/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Mono Project&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://www.monodevelop.com/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;MonoDevelop&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;https://notepad-plus-plus.org/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Notepad++&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=&quot;http://www.freepascal.org/&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;FreePascal&lt;/a&gt;&lt;/li&gt;\r\n&lt;/ul&gt;'),
(5, 'Полезное ПО', '&lt;ul style=&quot;list-style-type: square;&quot;&gt;\r\n&lt;li&gt;Microsoft Visual Studio&lt;/li&gt;\r\n&lt;li&gt;Notepad++&lt;/li&gt;\r\n&lt;li&gt;MonoDevelop&lt;/li&gt;\r\n&lt;li&gt;Qt&lt;/li&gt;\r\n&lt;li&gt;GNU Compiler Collection (Linux)&lt;/li&gt;\r\n&lt;li&gt;MinGW (Win)&lt;/li&gt;\r\n&lt;li&gt;SimplePM Android&lt;/li&gt;\r\n&lt;li&gt;SimplePM Code Editor (Win/Linux)&lt;/li&gt;\r\n&lt;/ul&gt;');

