--
-- Структура таблицы `spm_problems`
--

CREATE TABLE `spm_problems` (
  `id` mediumint(8) UNSIGNED NOT NULL,
  `difficulty` tinyint(3) UNSIGNED NOT NULL,
  `catId` smallint(5) UNSIGNED NOT NULL,
  `subCatId` smallint(5) UNSIGNED NOT NULL,
  `name` tinytext NOT NULL,
  `description` mediumtext NOT NULL,
  `input` text,
  `output` text,
  `input_ex` text,
  `output_ex` text
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

--
-- Дамп данных таблицы `spm_problems`
--

INSERT INTO `spm_problems` (`id`, `difficulty`, `catId`, `subCatId`, `name`, `description`, `input`, `output`, `input_ex`, `output_ex`) VALUES
(1001, 1, 1, 0, 'Hello, world!', 'Написать программу, выводящую на экран приветствие \"Hello, world!\"', NULL, 'В выходной поток вывести единственную строку: \"Hello, world!\"', NULL, 'Hello, world!'),
(1002, 1, 1, 25, 'A+B', 'Вывести на экран сумму чисел A и B', 'Во входном потоке даны через пробел 2 числа: 0<=a,b<=32000.', 'В выходной поток вывести сумму чисел, данных во входном потоке.', '73 126', '199'),
(1003, 1, 1, 25, 'C+D', 'Вывести на экран сумму вещественных чисел C и D', 'Во входном потоке даны через пробел 2 вещественных числа: 0<=a,b<=32000.', 'В выходной поток вывести сумму чисел, данных во входном потоке с 3 цифрами после запятой.', '27.07 11.04', '38.110'),
(1004, 2, 6, 33, 'Простой вывод', 'Вывести данный массив в выходной поток.', 'В первой строке входного потока задано натуральное число N - количество элементов целочисленного массива (N < 1000). \r\nВо второй строке перечислены через пробел значения элементов массива Ai (-32000 < Ai < 32000)', 'Вывести в столбик значения всех элементов заданного массива в прямом порядке.', '5<br/>\r\n-32000 345 2707 1104 567', '-32000<br/>\r\n345<br/>\r\n2707<br/>\r\n1104<br/>\r\n567<br/>'),
(1005, 2, 6, 33, '201. Поиск наименьшего', 'Дана последовательность чисел. Найти в ней наименьшее число.', 'Задано сначала число N (количество чисел в последовательности), а затем\r\nN чисел. Все числа - из диапазона Integer. N<=100', 'Выведите наименьшее число.', '736<br/>\r\n4 2 5 -1 4 6 2', '-1'),
(1006, 4, 6, 33, '202. Вывести одиноких', 'Даны два массива чисел. Требуется вывести в выходной файл те элементы\r\nпервого массива (в том порядке, в каком они идут в первом массиве),\r\nкоторых нет во втором массиве.', 'Во входном файле записано сначала число N - количество элементов в первом\r\nмассиве, затем N чисел - элементы массива. Затем записано число M - количество\r\nэлементов во втором массиве. Затем записаны элементы второго массива.\r\nКоличество элементов каждого массива не превышает 100. Сами элементы - \r\nчисла из диапазона Longint.', 'В выходной файл выведите те элементы первого массива, которых нет во втором в \r\nтом порядке, в каком они идут в первом массиве.', '7<br/>\r\n3 1 3 4 2 4 12<br/>\r\n6<br/>\r\n4 15 43 1 15 1', '3 3 2 12'),
(1007, 6, 6, 33, '203. День рождения Владыки', 'Главный повар решил устроить в Гимназии 28 День рождения Владыки Sirkadirov-а. Для этого он приготовил гимназистам N необычайно вкусных пицц и втайне \r\nпостановил, что первый пожаловавший отведать поварское кушанье школьник \r\nдолжен получить наибольшее количество вкусных пицц, а каждый последующий - \r\nстрого меньше, чем предыдущий (повару очень не нравилось, когда к \r\nприготовленному им обеду опаздывали и тот вынужден был остывать).\r\n<br/>\r\nКонечно, введенное правило оставляет существенный произвол в числе пицц, \r\nполучаемых очередным явившимся гимназистом, и это число не в последнюю очередь будет зависеть от отношения Sirkadirovа к гимназисту, а также \r\nот волшебных слов, произносимых им в честь Sirkadirovа. Например, 6 пицц могут быть в результате распределены по одной из следующих четырех схем: \r\n3+2+1 (три пиццы первому из пришедших школьников, две - второму и \r\nодну - третьему), 4+2, 5+1 и 6 (все пиццы съедает счастливчик, \r\nпришедший первым).\r\n<br/>\r\nПовар просит вас написать программу, определяющую, каким количеством различных \r\nспособов повар может распределить приготовленное лакомство среди школьников.', 'Входной файл содержит одно целое число N - количество приготовленных \r\nповаром пицц (0<=N<=200).', 'Выходной файл должен содержать одно целое число типа longint, равное количеству возможных распределений пицц.', '6', '4'),
(1008, 20, 19, 0, '237. Регулярные выражения', 'Требуется определить подходит ли заданное слово под заданный шаблон. Шаблон задается большими латинскими буквами, знаками \"?\" - любой символ, \"*\" - любая последовательность символов (даже пустая).', 'в первых двух строках записаны шаблон и слово: в одной строки записан шаблон - последовательность больших \r\nлатинских букв, \"?\" и \"*\", в другой  - слово, состоящее только \r\nиз больших латинских букв (строки короче 100 символов).', 'вывести YES, если слово подходит или NO, если нет.', 'SIRKADIROV<br/>\r\nS*KAD?ROV', 'YES'),
(1010, 15, 19, 0, '213. Простой калькулятор', 'Ваш одноклассник заплатил вам кругленькую сумму за то, что вы напишете ему калькулятор, который может выполнять простые арифметические операции. Он надеется на вас, не подведите!', 'В первой строке входного потока записано арифметическое выражение в виде:\r\n<число> <операция> <число> =\r\n<br/>\r\nЧисло - это натуральное число, не превышающее 10000.\r\n<операция> - один из знаков +, -, *\r\n<br/>\r\nВ начале строки, в конце строки, а также между числами и знаком операции,\r\nчислом и = может быть любое число пробелов (а может пробелов и не быть). Гарантируется, что длина строки не превышает 200 символов.', 'В выходной поток выведите результат вычисления выражения.', '2707    +1104   =', '3811'),
(1009, 2, 3, 0, 'Шахматная тоска', 'Даны координаты двух полей шахматной доски \r\n(координаты клетки - это 2 числа от 1 до 8: номер столбца и номер строки)\r\n\r\nОдного ли цвета эти клетки на шахматной доске? Вывести в выходной поток\r\nЕДИНСТВЕННУЮ СТРОКУ, содержащую YES, если они одного цвета, и NO в противном случае.', 'Во входном потоке даны 4 числа типа byte.', 'Вывести в выходной поток\r\nЕДИНСТВЕННУЮ СТРОКУ, содержащую YES, если они одного цвета, и NO в противном случае.', '1 1 2 2', 'YES'),
(1013, 6, 6, 0, 'Сортировка по возрастанию', 'Отсортируйте массив по возрастанию числовых значений его элементов.', 'В первой строке дано число N (1<=N<=100000), а во второй - N натуральных чисел из диапазона\r\nот 1 до 100.', 'Выведите все элементы массива в неубывающем порядке', '5<br/>\r\n3 1 2 4 2', '1 2 2 3 4'),
(1011, 15, 18, 0, '277. Игра на превосходство', 'В школьной газете одной Запорожской гимназии недавно появилась новая рубрика, которую вёл известный всем учитель информатики под псевдонимом ЮН, её суть была проста: каждую неделю в газете публиковался шифр вида <число>+<число>=<число>, каждое число состоит не меньше чем из 1\r\nи не больше, чем из 7 заглавных английских букв. Тот, кто угадает задуманные учителем информатики числа, которые превращают данное выражение в верное равенство, получит пароль от школьного Wi-Fi.\r\n<br/>\r\nТак как все считают вас великим хакером, то именно вам поручили написать программу, которая по заданному шифру выводит все возможные варианты решения данного выражения.\r\n<br/>\r\nПоспешите, именно от вас зависит судьба всех ваших одноклассников и друзей с параллели, ведь скоро экзамен, а у многих ещё конь не валялся!', 'В единственной строке входного файла записан ребус.\r\nРебус состоит из больших латинских букв, знаков плюс и равно и имеет\r\nвид <число>+<число>=<число>. Каждое число состоит не меньше чем из 1\r\nи не больше, чем из 7 букв.', 'Выведите каждое решение ребуса на отдельной строке.\r\nРешение выводится в виде верного равенства, соответствующего\r\nописанному ребусу, в котором все буквы заменены цифрами.\r\n<br/>\r\nРешением ребуса называется такая замена букв цифрами,\r\nчто каждая буква заменяется цифрой от 1 до 9 (цифра 0 в\r\nэтой задаче не допускается) так, что разные буквы заменяются\r\nразными цифрами, и написанное равенство оказывается верным.', 'A+B=CD', '3+9=12<br/>\r\n4+8=12<br/>\r\n4+9=13<br/>\r\n5+7=12<br/>\r\n5+8=13<br/>\r\n5+9=14<br/>\r\n6+7=13<br/>\r\n6+8=14<br/>\r\n6+9=15<br/>\r\n7+5=12<br/>\r\n7+6=13<br/>\r\n7+8=15<br/>\r\n7+9=16<br/>\r\n8+4=12<br/>\r\n8+5=13<br/>\r\n8+6=14<br/>\r\n8+7=15<br/>\r\n8+9=17<br/>\r\n9+3=12<br/>\r\n9+4=13<br/>\r\n9+5=14<br/>\r\n9+6=15<br/>\r\n9+7=16<br/>\r\n9+8=17'),
(1012, 10, 8, 0, '218. Распаковка строки', 'Будем рассматривать только строчки, состоящие из заглавных латинских букв. Например, рассмотрим строку AAAABCCCCCDDDD. Длина этой строки равна 14. Поскольку строка состоит только из латинских букв, повторяющиеся символы могут быть удалены и заменены числами, определяющими количество повторений. Таким образом, данная строка может быть представлена как 4AB5C4D. Длина такой строки 7. Описанный метод мы назовем упаковкой строки. \r\n<br/>\r\nНапишите программу, которая берет упакованную строчку и восстанавливает по ней исходную строку.', 'Входной поток содержит одну упакованную строку. В строке могут встречаться только конструкции вида nA, где n - количество повторений символа (целое число от 2 до 99), а A - заглавная латинская буква, \r\nлибо конструкции вида A, то есть символ без числа, определяющего количество повторений. Максимальная длина строки не превышает 80.', 'В выходной файл выведите восстановленную строку. При этом строка должна быть разбита на строчки длиной ровно по 40 символов (за исключением последней, которая может содержать меньше 40 символов).', '27A7B', 'AAAAAAAAAAAAAAAAAAAAAAAAAAABBBBBBB');

