INSERT INTO `spm_submissions` (`submissionId`, `codeLang`, `userId`, `problemId`, `testType`, `problemCode`, `customTest`, `status`, `hasError`, `compiler_text`, `result`, `b`) VALUES
(130, 'freepascal', 1, 1006, 'release', 'var n,m:integer;\r\n    a,b:array[1..100] of longint;\r\n    i,j:integer;\r\n    f:boolean;\r\nbegin\r\n    read(n);\r\n    for i:=1 to n do read(a[i]);\r\n    read(m);\r\n    for j:=1 to n do read(b[j]);\r\n    for i:=1 to n do begin\r\n        f:=true;\r\n        for j:=1 to m do\r\n         if a[i]=b[j] then\r\n            f:=false;\r\n        if f then write(a[i],\' \');\r\n    end;\r\nend.', '', 'ready', 0, 'Free Pascal Compiler version 3.0.2 [2017/02/13] for x86_64\r\nCopyright (c) 1993-2017 by Florian Klaempfl and others\r\nTarget OS: Win64 for x64\r\nCompiling D:SimplePM_Temp130.pas\r\nLinking D:SimplePM_Temp130.exe\r\n17 lines compiled, 0.0 sec, 33360 bytes code, 1316 bytes data\r\n', '+++', 4),
(128, 'freepascal', 1, 1004, 'release', 'var a:array[1..100] of integer;\r\n    i,n:integer;\r\nbegin\r\n    readln(n);\r\n    for i:=1 to n do begin\r\n        read(a[i]);\r\n        writeln(a[i]);\r\n    end;\r\nend.', '', 'ready', 0, 'Free Pascal Compiler version 3.0.2 [2017/02/13] for x86_64\r\nCopyright (c) 1993-2017 by Florian Klaempfl and others\r\nTarget OS: Win64 for x64\r\nCompiling D:SimplePM_Temp128.pas\r\nLinking D:SimplePM_Temp128.exe\r\n9 lines compiled, 0.0 sec, 32992 bytes code, 1316 bytes data\r\n', '+++', 2),
(127, 'freepascal', 1, 1003, 'release', 'var c,d:real;\r\nbegin\r\n    readln(c,d);\r\n    write((c+d):0:3);\r\nend.', '', 'ready', 0, 'Free Pascal Compiler version 3.0.2 [2017/02/13] for x86_64\r\nCopyright (c) 1993-2017 by Florian Klaempfl and others\r\nTarget OS: Win64 for x64\r\nCompiling D:SimplePM_Temp127.pas\r\nLinking D:SimplePM_Temp127.exe\r\n5 lines compiled, 0.0 sec, 41008 bytes code, 2276 bytes data\r\n', '++++', 1),
